import React from 'react';
import im from "../assets/img.jpg"

const Login = () => {
  return (
    <div className='form-body'>
      <div className='form-page'>
        <div className="left">
            <img src ={im} alt='login image'/>
        </div>
        <div className="right"></div>
      </div>
    </div>
  )
}

export default Login
